import React from 'react'
import { Navbar, Nav, Container, NavDropdown, Button, Row, Col, NavItem, NavLink } from 'react-bootstrap';
import { styled } from '@mui/material/styles';
import Table from '@mui/material/Table';
import TableBody from '@mui/material/TableBody';
import TableCell, { tableCellClasses } from '@mui/material/TableCell';
import TableContainer from '@mui/material/TableContainer';
import TableHead from '@mui/material/TableHead';
import TableRow from '@mui/material/TableRow';
import { connect } from 'react-redux';
import Paper from '@mui/material/Paper';

const StyledTableCell = styled(TableCell)(({ theme }) => ({
    [`&.${tableCellClasses.head}`]: {
        backgroundColor: theme.palette.common.black,
        color: theme.palette.common.white,
    },
    [`&.${tableCellClasses.body}`]: {
        fontSize: 14,
    },
}));

const StyledTableRow = styled(TableRow)(({ theme }) => ({
    '&:nth-of-type(odd)': {
        backgroundColor: theme.palette.action.hover,
    },
    // hide last border
    '&:last-child td, &:last-child th': {
        border: 0,
    },
}));

function createData(obj) {
    return obj.state;
}
var rows = [];



const Shipmentdetails = (props) => {

    let data = props.status.TransitEvents

    let rows = data.map((obj) => { return transform(obj) })

    function transform(object) {
        let values = Object.values(object);
        let transformed_values = [values[0], values[1], values[1],'Smouha'];
        return transformed_values;
    }
    console.log("yarab" , rows)
    console.log("yarab" , rows[0])
    console.log(props.status.TransitEvents.map((event) => {
        createData(event)
    }))

    console.log('Data', props.status.TransitEvents.map((row) => {
        return { ...row, hub: 'Smouha' };
    }))
    console.log('Dataa', props.status.TransitEvents.map((row) => {
        return { ...row, hub: 'Smouha' };
    }).map((obj) => { return Object.values(obj) }))
    console.log('Dataaa', props.status.TransitEvents.map((row) => {
        return { ...row, hub: 'Smouha' };
    }).map((obj) => { return new Set(Object.values(obj)) }))

    return (
        <Container>
            <Row>
                <Col className='col-12 col-md-8 '>
                    <TableContainer component={Paper}>
                        <Table sx={{ minWidth: 700 }} aria-label="customized table">
                            <TableHead>
                                <TableRow>
                                    <StyledTableCell>Hub</StyledTableCell>
                                    <StyledTableCell align="right">Date</StyledTableCell>
                                    <StyledTableCell align="right">Time</StyledTableCell>
                                    <StyledTableCell align="right">Details</StyledTableCell>
                                </TableRow>
                            </TableHead>
                            <TableBody>

                                {rows.map((row) => (
                                    <StyledTableRow key={row[3]}>
                                        <StyledTableCell component="th" scope="row">
                                            {row[3]}
                                        </StyledTableCell>
                                        <StyledTableCell align="right">{row[2]}</StyledTableCell>
                                        <StyledTableCell align="right">{row[1]}</StyledTableCell>
                                        <StyledTableCell align="right">{row[0]}</StyledTableCell>
                                    </StyledTableRow>
                                ))}
                            </TableBody>
                        </Table>
                    </TableContainer>

                </Col>
                <Col className='col-12 col-md-4 '>
                </Col>
            </Row>
        </Container>
    )
}

const mapStateToProps = state => ({

    status: state.guest.details,
    detailsfetched: state.guest.detailsfetched
})
export default connect(mapStateToProps)(Shipmentdetails);
